import React from 'react'

import ReactLoading from 'react-loading'

const Loading = (props) => {
  const {
    type, color, height, width,
  } = props
  return (
    <ReactLoading
      type={type}
      color={color}
      height={height}
      width={width}
    />
  )
}
export default Loading
